INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (13,'Fire in the Hole Podcast','http://is2.mzstatic.com/image/thumb/Music62/v4/89/a8/24/89a8249b-2aec-420d-9ce4-d0dc3ba4cc8b/source/600x600bb.jpg','What\'s wrong with the world? We don\'t know, but we love talking about it like we do. Fire in the Hole is exactly what is sounds like, a couple of guys trying to wrap their heads around the madness while tossing some truth bombs. Don\'t worry though, we have guests on, good ones too!\r\n\r\nFire in the Hole is a new conversational podcast by Jason Ambrus and Richard Lajoie that covers a range of topics that we sorta make up as we go along. The ultimate idea is to get a real conversation going, not just knee-jerk react to ideas. Let\'s get to the bottom of things, or at least have a laugh, a few beers, and take our brains out for a little jog.\r\n\r\nFitH also features guest appearances from a wide range of professionals, artists, and just cool people in general.','English','Comedy | Podcasting | Technology','http://www.stitcher.com/podcast/fire-in-the-hole-podcast?refid=stpr','Richard and Jason',1049340680,'2020-02-02 12:00:00','2020-02-02 12:00:00');
