INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (130,'All About Breastfeeding: Breastfeeding with confidence|inspiring stories|expert advice','http://is3.mzstatic.com/image/thumb/Music62/v4/28/c9/66/28c96639-c256-33e9-e932-35faa8c8bfbf/source/600x600bb.jpg','Lori Jill Isenstadt from All About Breastfeeding is on a  mission to normalize breastfeeding..... all around the world. She has interviews with  Dr Dawn Obrecht, Abby Theuring, Jessica Shortall,  Dr. Jack Newman, Maureen Minchin and more.  Learn from mothers who are actively breastfeeding, sharing their personal stories of breastfeeding with ease and babies who just know exactly what to do.  Hear intimate stories from mothers about their struggles and pain with breastfeeding.  Everyday moms sharing extraordinary stories of what life was like behind their breastfeeding doors. Get help with common concerns such as low milk supply, oversupply, babies who are tongue and lip tied,  premature babies, sick babies who are breastfeeding as well as babies who have had surgeries such as heart and cleft surgeries.  Book authors and physicians who are huge breastfeeding supporters share their expertise as they all have a common interest.  To  normalize breastfeeding.  Lori  interviews mothers and professionals about breastfeeding as it relates to pregnancy childbirth postpartum mothering and newborn parenting','English','Alternative Health | Education | Health | Kids & Family','http://allaboutbreastfeeding.biz/podcast','Lori Isenstadt,IBCLC',582815870,'2020-02-14 08:00:00','2020-02-14 08:00:00');
INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (131,'The Party in My Plants Podcast','http://is3.mzstatic.com/image/thumb/Music118/v4/aa/f4/46/aaf44609-d616-1983-46ef-3816f44815bc/source/600x600bb.jpg','Finally! The show that makes healthy living not suck! So you’ll actually want to do it. And so then you’ll actually start feeling, looking and living your best. Expect two exciting types of shows. One: a light-hearted conversation with a pro who takes the HELL out of HEALTHY (be it with a smoothie, acupuncture needles, or a non-judgy style of yoga). Two: me venting or answering your questions (which you can submit on partyinmyplants.com/answermyq)! With episodes about plant-based eating, easy healthy cooking, fitness, digestion, meditation, weight loss, healthy travel, sneaking snacks into movies, beating anxiety and cohabiting with non-healthy people...you can expect to feel chill and confident with a new, easy hack for healthier living each time your headphones stream this show.','English','Alternative Health | Fitness & Nutrition | Health','http://www.partyinmyplants.com/','Talia Pollock',604012428,'2020-02-14 08:00:00','2020-02-14 08:00:00');
