INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (966,'Stories of Our City','http://is3.mzstatic.com/image/thumb/Music71/v4/ce/ad/99/cead99d0-c8b0-5aac-9cbc-d21cba35f454/source/600x600bb.jpg','Stories of Our City is a worldwide project to cultivate community and understanding by sharing real stories from real people around the globe. We produce these stories to reveal that our everyday experiences with family, love, religion, and culture are often similar to those of others living in cities and villages across the globe. We believe that when we share and celebrate a common humanity we can begin to erase the boundaries and labels that divide us. When we take the time to listen, we can begin to recognize the “other” as the same as us, giving us the foundation for global community.','English','Arts | Places & Travel | Society & Culture','http://storiesofourcity.com','Katy Gilbert',499805077,'2020-02-14 08:00:00','2020-02-14 08:00:00');
