INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (1139,'Inc. Radio','http://is1.mzstatic.com/image/thumb/Music71/v4/6d/71/58/6d715861-3f75-d30c-ec80-884e31b979d0/source/600x600bb.jpg','Inc. Radio helps business owners like you on the sometimes rocky voyage from garage to fully managed company. As the most trusted resource for leaders focused on growing their companies, Inc. has the organization, knowledge, experience and critical skill sets needed to provide real value to our listeners. Inc. Magazine Live delivers real stories and real solutions for today\'s new company creators.  As an entrepreneur, you need to be armed with information that will help your company grow and succeed in today\'s competitive business environment. Inc. Radio brings you top advice from today\'s industry leaders, detailed profiles of up-and-coming forces in the marketplace and sound guidance give you the boost you need to stay ahead and remain in control of your financial future. Join Alan Taylor broadcasting weekly from our studios in Los Angeles and on the road at live events.','English','Careers | Business News | Business | Management & Marketing | Investing','https://www.ernlive.com/show/inc-radio/15335/feed','Entertainment Right Now',562324120,'2020-02-14 08:00:00','2020-02-14 08:00:00');
