INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (1142,'In The Trenches with Tom Morkes','http://is5.mzstatic.com/image/thumb/Music118/v4/e8/62/86/e862864b-deac-5737-fcec-1a10fd9db1e0/source/600x600bb.jpg','In The Trenches with Tom Morkes tells the story of entrepreneurs, business owners, founders, inventors, and leaders who are doing the hard, creative work of building businesses that matters. Tom Morkes interviews these high-impact world-changers and cuts through the fluff so you can get right inside the brain of these creators. Listen to In The Trenches and you\'ll hear from bootstrapped startup founders, to self-made millionaires, to bestselling authors, to people who turned their creative pursuit into full-fledged businesses, and more. Here are some of the subjects we cover: hot to start a business from scratch, how to launch a product, how to market and sell your products online, influencer marketing, affiliate marketing, online business strategies, copywriting techniques, and much, much more. All interviews are unscripted, with as little editing as possible. Tom Morkes believes the only way to go deep on a subject is to let it happen organically...so we hope you forgive any craziness that happens during the episodes; it\'s all real. FINALLY - if you enjoy the show, please leave a review. Thanks in advance for your support.','English','Careers | Management & Marketing | Business','https://insurgent.podbean.com','Tom Morkes | online business and marketing',900190732,'2020-02-14 08:00:00','2020-02-14 08:00:00');
