INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (1416,'The Hilarious World of Depression','http://is4.mzstatic.com/image/thumb/Music71/v4/6f/8b/b0/6f8bb0cb-203f-d625-f783-540786100360/source/600x600bb.jpg','A show about clinical depression... with laughs? Well, yeah. Depression is an incredibly common and isolating disease experienced by millions, yet often stigmatized by society. The Hilarious World of Depression is a series of frank, moving, and, yes, funny conversations with top comedians and funny creative people who have dealt with this disease, hosted by veteran humorist and public radio host John Moe. Winner of the Webby Award for Best Comedy Podcast. Join guests such as John Green, Russell Brand, Margaret Cho, Wayne Brady, and Wil Wheaton to learn how they\'ve dealt with depression and managed to laugh along the way. If you have not met the disease personally, it\'s almost certain that someone you know has, whether it\'s a friend, family member, colleague, or neighbor. Depression is a vicious cycle of solitude and stigma that leaves people miserable and sometimes dead. Frankly, we’re not going to put up with that anymore. The Hilarious World of Depression is not medical treatment and should not be seen as a substitute for therapy or medication. But it is a chance to gain some insight, have a few laughs, and realize that people with depression are not alone and that together, we can all feel a bit better. The Hilarious World of Depression is made possible by a grant from HealthPartners’ and its Make It Okay campaign which works to reduce the stigma of mental health. www.makeitok.org','English','Comedy','https://www.apmpodcasts.org/thwod/','American Public Media',1171247279,'2020-02-14 08:00:00','2020-02-14 08:00:00');
