INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (1656,'Love Your Bodd','http://is1.mzstatic.com/image/thumb/Music111/v4/38/32/fb/3832fb09-fb6c-e80f-19ff-5b92964196be/source/600x600bb.jpg','We all have insecurities. You are not alone in your struggles. Love Your Bodd is a podcast focused on creating a dialogue around body image, specifically in the arts. In Love Your Bodd, Heather Boddy sits down with artists, activists, and health/fitness professionals to discuss body image, race, and how our insecurities make us who we are. The lack of representation in the arts and media is overwhelming. It\'s time to hold up a mirror to the industry and talk about how it can affect us. It\'s also time to hold a mirror up to ourselves and truly love that person we see staring back at us. Do you love your bodd?','English','Fitness & Nutrition | Self-Help | Health | Arts','http://loveyourbodd.libsyn.com/','Heather Boddy',292411568,'2020-02-14 08:00:00','2020-02-14 08:00:00');
