INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (1883,'Harrison Podcast','http://is5.mzstatic.com/image/thumb/Music111/v4/e7/48/89/e748899c-a72c-c8e9-82a5-6987dc523193/source/600x600bb.jpg','The Harrison Podcast is an extension from a lengthy research project on the one month presidency of William Henry Harrison. For those who don’t know, Harrison was inaugurated in March 4th, 1841 and died on April 4th, 1841. It was a time positioned between the Revolution and the Civil War filled with characters who played a pivotal role in American history. Harrison rode into office with a decisive majority in 1840, beating incumbent president Martin Van Buren but was just in the midst of getting his administration going when his life was cut short. The podcast series will examine the America of 1841, some of the major figures of the time, the issues that were being faced, and attempt to answer the question of why the one month president is more important than he’s been portrayed to date in histories of the time.','English','History | Society & Culture','http://whhpodcast.blubrry.com','Jerry Landry',1150862565,'2020-02-14 08:00:00','2020-02-14 08:00:00');
