INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (1944,'Solutions and Strategies with Dr Sean: Living the Challenge','http://is1.mzstatic.com/image/thumb/Music111/v4/03/e5/4d/03e54d51-807b-7232-4756-2f50ea229f83/source/600x600bb.jpg','Our program promotes a solution-based problem solving focus for individuals with disabilities, Parents, family members and professionals living or assisting individuals with exceptional needs. Individuals and families can become stronger together. You’ll feel a validation of the problems, find commonality and universalization with others that have the same challenges and questions and together we’ll find solutions. Topics discussed will include Parenting, School Issues, working with individuals on the Autism spectrum and those with Asperger’s Syndrome. We’ll discuss sibling concerns, challenges in home and school, professional responsibilities to the world of exceptional needs, academic difficulties and solutions for students and we’ll hear from parents, teachers and individuals with exceptional needs, Autism Spectrum Disorders or other developmental disabilities. Tune in to Solutions and Strategies with Dr. Sean, Thursdays at 8 AM Pacific on VoiceAmerica Health and Wellness.','English','Kids & Family','https://www.voiceamerica.com/show/2643/solutions-and-strategies-with-dr-sean-living-the-challenge','VoiceAmerica',1039465606,'2020-02-14 08:00:00','2020-02-14 08:00:00');
