INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (1950,'How To Talk To Kids About Anything','http://is2.mzstatic.com/image/thumb/Music118/v4/fc/c2/a2/fcc2a29e-1ce8-887c-b2ce-6f3abd6cd966/source/600x600bb.jpg','The How to Talk to Kids about Anything Parenting Podcast, hosted by Dr. Robyn Silverman (Child & Teen Development Specialist, parenting coach, author, speaker and mom of 2), provides hands-on tips, powerful scripts, inspiring stories and specific steps to make even the toughest conversations easier. Featuring revealing interviews with the top experts in their fields, How To Talk to Kids about Anything gives parents and educators the tools and take-aways they\'ve been looking for but have yet to find. From bullying and the gift of failure to death, divorce, money, sex, anger, anxiety and more, listeners will discover what to do, what to say and how to say it in a non-judgmental, honest, accessible format. Consider Dr. Robyn’s How to Talk to Kid about Anything podcast, your one-stop-parenting-shop delivering exactly what you need, when you need it, from someone you trust.','English','Kids & Family | Education | K-12 | Health','http://drrobynsilverman.com/category/podcast/','Dr. Robyn Silverman',1192546774,'2020-02-14 08:00:00','2020-02-14 08:00:00');
