INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (1954,'The Fit2Fat2Fit Experience','http://is3.mzstatic.com/image/thumb/Music62/v4/9c/3a/97/9c3a9718-3a02-5691-2d9f-a472f6c04eec/source/600x600bb.jpg','The Fit2Fat2Fit Experience Podcast features Drew and Lynn Manning of www.fit2fat2fit.com and www.2fitathome.com.  They bring their unique perspective on health and fitness to the podcasting world.  Drew gained international media attention from his journey of gaining and losing 75 lbs. on purpose by blogging and writing a NY Times Best Selling book about it (Fit2Fat2Fit) and his wife, Lynn, is a women\'s fitness specialist, but is also an admitted foodie\"\"\".  With this unique balance they dive into why diets don\'t work. People lose weight only to gain it back. Why does it seem so hard? Because focusing on just nutrition and exercise is missing the mark. Overall health and wellness is key to long-term success and often our industry neglects this. They answer your questions and interview leaders in the industry to share secrets about real transformation and long term success. Change comes from the inside out so join us on this journey!\"\"\"\"\"','English','Kids & Family | Health | Fitness & Nutrition','http://fit2fat2fit.com/Podcast','Drew Manning',632334473,'2020-02-14 08:00:00','2020-02-14 08:00:00');
