INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (1991,'Ears on Art','http://is1.mzstatic.com/image/thumb/Music128/v4/1e/29/7e/1e297edf-abbf-6345-77a5-36a751984301/source/600x600bb.jpg','“Ears On Art” airs the first two Wednesdays of each month at 1:30 P.M. as a part of Issues &amp; Ideas . It began in earnest on April 1, 1999 with a half hour a month broadcast. Things have changed considerably since then. We have changed times and format, but the founding purpose has remained the same. In the beginning there were four hosts: Bill Beeson, Karen Kile, Gail Johnson, and me, Crissa Hewitt. Our aim was to create a magazine format with at least three segments. Bill opened the program with a commentary based on the show’s theme. Gail closed the show with a five-minute arts calendar. One or two interviews rounded out the thirty minutes. I spent the majority of my time learning how to tape, edit, and put in the finishing touches so that the recorded program could be aired. By 2002 the format had changed. Even a decade ago there was far too much information to create a comprehensive arts event calendar in five minutes. Bill continued to do the commentaries, but Gail and Karen','English','Local | Government & Organizations','http://kcbx.org','KCBX',1114127175,'2020-02-14 08:00:00','2020-02-14 08:00:00');
