INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (2362,'Hot & Bothered: A Dissent Climate Podcast','http://is5.mzstatic.com/image/thumb/Music71/v4/e6/48/a6/e648a646-7aa6-7394-98ff-f73c94187342/source/600x600bb.jpg','Hot & Bothered, hosted by Dissent, is a new podcast on climate change politics for the 99%. Co-hosts Daniel Aldana Cohen and Kate Aronoff investigate the intersections of climate, politics, and the economy, with dispatches from grassroots organizers alongside leading wonks and scholars. Can there be prosperity and redistribution without oil, coal, or gas? Or is our low-carbon future bound to be nasty, brutish, and austere? What kinds of movements can power a fair and thorough transformation of our economy? Hot & Bothered\'s first season of six episodes pairs reported news roundups with feature interviews on some of climate politics’ most burning questions. If climate justice demands big ideas and even bigger movements, we\'ll put a mic to them. We’re hot, bothered, and recording. And we want to hear from you! Tweet at us at #HotBotheredClimate.','English','News & Politics','https://dissentmagazine.org/tag/hot-bothered','Dissent',1138423274,'2020-02-14 08:00:00','2020-02-14 08:00:00');
