INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (2602,'Loco Gringo Mexico','http://is1.mzstatic.com/image/thumb/Music71/v4/5c/f2/57/5cf257fe-614b-de50-d550-84d346e3b82d/source/600x600bb.jpg','LocoGringo Mexico gives you local insights, vacation tips and stories from people who live and work in the Riviera Maya and Yucatan Peninsula of Mexico.  Our host Kay Walten, will introduce you to people in Mexico who tell of their journey to the Yucatan, their local scoop on the people, the Mexico and Mayan culture, places not to miss on your next vacation, food and more.  LocoGringo gives you travel info that you won’t find in a travel guidebook.  Discover Mexico for your next vacation on a more intimate level than a typical tourist.  As an expat, Kay has been working in vacation and tourism in Mexico since 1992. She is also co-founder of the vacation rental site LocoGringo.com.','English','Places & Travel | Society & Culture | Personal Journals | Kids & Family','https://www.locogringo.com/podcasts/','Kay Walten',1164456274,'2020-02-14 08:00:00','2020-02-14 08:00:00');
