INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (3521,'Morning Mindfulness - Two Positive Minutes to Start Your Day with Dr. Jin','http://is3.mzstatic.com/image/thumb/Music71/v4/7b/6e/ff/7b6eff52-9faa-e5c0-fb26-6e1fc74a7186/source/600x600bb.jpg','This podcast is about mindfulness. No, no, no, not about just sitting and doing nothing and emptying your mind. That is not mindfulness, that would be  mindlessness. But we are talking about mindfulness. It is about being in the moment. It is about paying attention. It is about nonjudgmental attitude. It is about awareness.  It is about making wiser decisions. I am talking about lessons I\'ve learned on my Martial Arts and Yoga journey, and what I\'ve learned practicing meditation. My episodes are inspired by lessons I got from World\'s greatest success and leadership teachers, like Dale Carnegie, Napoleon Hill, Maxwell Maltz, Og Mandino, John Maxwell, David J. Schwartz, Zig Ziglar, Robert Kiyosaki, Dr. Shed Helmstetter, and many many others.','English','Religion & Spirituality | Other | Health | Self-Help | Society & Culture | Philosophy','http://HPLN.org','Yu-Jin Sokushin',853581751,'2020-02-14 08:00:00','2020-02-14 08:00:00');
