INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (3534,'Meditations by Gregory T. Obert','http://is4.mzstatic.com/image/thumb/Music122/v4/43/5b/e2/435be22d-827b-f1fd-3e47-7dec86aeec99/source/600x600bb.jpg','Welcome to Meditations!  Please join Gregory T. Obert as he reads aloud guided meditations by featured healers.  Take advantage of a podcast that brings you true healing and wellness with each new episode.  Thanks for listening, and we hope you enjoy!  DISCLAIMER:  This show is not intended to diagnose, treat, cure, or prevent any disease or health condition.  Be sure to speak with your health care professional about adding meditation to your health care regimen.  All risks taken by participating in meditation are the listener\'s alone.  Do not meditate while driving, operating machinery, or doing any activity that requires you to be alert.  Please use good judgement and be safe when meditating.','English','Religion & Spirituality | Spirituality | Health | Self-Help | Alternative Health','http://gto2552.hipcast.com/podcast/Hk78Jb','Gregory T. Obert',879898307,'2020-02-14 08:00:00','2020-02-14 08:00:00');
INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (3535,'Various Topic 2017','http://is3.mzstatic.com/image/thumb/Music111/v4/d7/87/7d/d7877d5b-ed13-9a34-0c6e-0a51d6b32370/source/600x600bb.jpg','It is difficult to find someone from the West that both understands and can elegantly express the theory behind an Eastern mystical tradition. It is even more difficult to find a modern mystic. In Swami Tripurari we have both: a traditional mystic who can articulate the teachings of an ancient spiritual tradition. A compelling speaker, to hear him and be in his presence is itself a spiritual experience. Swami Tripurari met his initiating guru, Srila A. C. Bhaktivedanta Swami Prabhupada, in the spring of 1972. He relates that he felt as though he had met a long-lost friend, as Srila Prabhupada blessed him with his all-knowing glance. Over the years of service that followed, Srila Prabhupada showered him with affection and repeatedly expressed his appreciation for his selfless service and ability to inspire others. In 1974 Srila Prabhupada instructed him in a widely circulated letter, “So you organize freely. You are the incarnation of book distribution. Take the leadership and do the needful.” Accordingly, Swami Tripurari has set an example of one who is independently thoughtful and capable of making an insightful literary contribution to the world. In 1975 Swami Tripurari was initiated by Srila Prabhupada into the renounced order of sannyasa.','English','Religion & Spirituality | Spirituality | Hinduism | Philosophy | Society & Culture','http://podcasts.askswami.info','Dulal Chandra dasa',1086017276,'2020-02-14 08:00:00','2020-02-14 08:00:00');
