INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (3752,'Healthy Business Healthy Profits','http://is3.mzstatic.com/image/thumb/Music71/v4/40/82/72/40827226-c48c-0fa4-20f5-a4204121b09b/source/600x600bb.jpg','This show helps entrepreneurs overwhelmed with the challenges of leading and managing a rapidly growing company.  We focus on smart growth and provide the tips, strategies and solutions owners need to tackle the problems that growing companies face along the way.  We look at topics like cash flow management, financial analysis, planning, operations and many other topics around business management. We’ll interview experts from various business specialties and feature entrepreneurs who have dealt with growth problems first hand and learn how they overcame them.  Our goal is to help you gain value and insight from other’s experiences.','English','Society & Culture | Business | Education','http://healthybusinesshealthyprofits.com','Lisa Roberts',791400537,'2020-02-14 08:00:00','2020-02-14 08:00:00');
INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (3753,'Bytemarks Cafe','http://is1.mzstatic.com/image/thumb/Music/v4/80/dc/99/80dc9916-c3f9-e6b1-a571-12f84f9ebe3f/source/600x600bb.jpg','Welcome to Bytemarks Cafe. The radio show runs every Wednesday on Hawaii Public Radio from 5-6pm in the afternoon. Please tune in to KIPO - 89.3 FM and catch the latest happenings in the tech world with a distinctively Hawaii-centric perspective. Located out in the middle of the Pacific, we are definitely not a Silicon Valley. Nevertheless, there are a lot of interesting projects going on in web 2.0 development, bio tech, alternative energy, dual-use, environmental and digital media. Our goal at Bytemarks Cafe is showcase these projects and build a broader awareness of technology in Hawaii. Our aim is to also encourage dialog and interaction, both online and in real space. Thanks for joining us on Bytemarks Cafe.','English','Society & Culture | Business | Technology | Business News | History | Tech News','http://www.bytemarkscafe.org','Bytemarks Cafe',1166424341,'2020-02-14 08:00:00','2020-02-14 08:00:00');
