INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (3798,'Through The Eyes Of Women','http://is2.mzstatic.com/image/thumb/Music117/v4/cf/5e/72/cf5e72eb-27da-f442-3186-c09fc5627be5/source/600x600bb.jpg','Mondays 1:30PM-2:00PM Through the Eyes of Women is a locally produced, public affairs program which has aired on KHSU since 1985. KHSU is located at Humboldt State University in Arcata, California. TTEOW is produced for, by and about women. Our staff is completely volunteer. Through the Eyes of Women provides programming that explores women’s political, social and economic lives, as well as the obstacles and restrictions experienced in the form of discrimination. In addition, Through the Eyes of Women is dedicated to the inclusion of a wide range of issues, perspectives, opinions and knowledge of women. We seek to celebrate women and all their contributions to the local and global communities. Shows are archived here for two weeks after airing, and permanently archived in our blog content. If you have an idea for a topic to air on Through the Eyes of Women, Please email the producer at tteowproducer@gmail.com or leave a message at 707 826-4807.','English','Society & Culture | News & Politics','http://khsu.drupal.publicbroadcasting.net','KHSU',115148332,'2020-02-14 08:00:00','2020-02-14 08:00:00');
