INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (3807,'Entitled to My Friend\'s Opinion','http://is4.mzstatic.com/image/thumb/Music122/v4/12/02/a6/1202a62c-713c-50c8-8a4e-575a3ec66e01/source/600x600bb.jpg','In a country dominated by polarizing ‘left’ and ‘right’ views of the world, it is increasingly arduous to feel connected to what matters most. Our aim is to provide insight, discussion, and serve as voices to those who have become disenchanted with the intensifying partisan nature of the world. We hope to practice intellectual humility and bridge intellectual gaps, to ask experts to enlighten us and peers to engage us. We are hyperaware of our generation\'s incestuous instinct to perpetuate partisan ideologies while closing itself to new opinions. In many ways, our name is an ironic anthem to this misguiding nature of our generation, hoping to propel ourselves and others into the exposure of new ideas. We long ago established our own opinions, and frankly, we\'re sick of brandishing them. So, now we turn to you all. Forgive us if we\'re infringing, but we do believe that we\'re Entitled to Our Friend\'s Opinion, and that you are entitled to ours, as well. All in the search for truth.','English','Society & Culture | News & Politics | Podcasting | Technology','https://www.entitledopinions.com/podcasts/','Entitled to My Friend\'s Opinion',920788056,'2020-02-14 08:00:00','2020-02-14 08:00:00');
