INSERT INTO `` (`id`,`title`,`image`,`description`,`language`,`categories`,`website`,`author`,`itunes_id`,`createdAt`,`updatedAt`) VALUES (4020,'Buffalo Bandits','http://is4.mzstatic.com/image/thumb/Music111/v4/ac/54/72/ac547238-5c3f-8f2a-d1ae-363cf6cb20f1/source/600x600bb.jpg','The Buffalo Bandits are a team in the National Lacrosse League (NLL). They play at First Niagara Center iin Buffalo, New York. The Bandits played in the Major Indoor Lacrosse League from 1992 to 1997, until the MILL turned into the NLL in 1998.The Bandits played their first season in 1992. They played home games at Buffalo Memorial Auditorium sharing with the Buffalo Sabres until its closure in 1996. The Bandits became the first franchise in MILL/NLL history[1][2] to win a championship in its first season. The Bandits repeated as champions in their second season, lost the Championship game their third season and captured their third Championship in 1996, their fifth season. It was not until 1999, their eighth season, that the Bandits did not make the playoffs.Since their 1996 Championship-winning season, the Bandits returned to the NLL Championship game on three separate occasions (1997, 2004, 2006) only to lose each time (including twice at home). It wouldn\'t be until 2008 that the Bandits would win their elusive fourth Championship, a 14-13 triumph over Portland. Buffalo Bandits On-Demand Audio is presented by Northwest. Banking Made Simple.','English','Sports & Recreation | Professional','http://www.wgr550.com/','Entercom Communications Corp.',1035062584,'2020-02-14 08:00:00','2020-02-14 08:00:00');
